    {
      "date": "1765-07-27",
      "tags_section": "Personen so ihre Dienste offeriren:",
      "text": "1. Ein junger Mensch 20. Jahr alt von sehr honnête Eltren / wegen deſſen Conduitte sich in Auſpurg nach Belieben kan erkundiget werden / ſuchet Condition als Handels-Bedienter in einem guten Hauß / allwo in Scripturen recht viel zu thun ist) verspricht dem Herrn Prediger Dienste- freundlich gebatten / zu befehlen worzu dieses Geld dienen/ oder wohin solches verwendet werden solle. Von den vor acht Tagen gesunden Artikeln stehet annoch zur Dispoſition der Eigenthümern der Weiber – ſack sambt Zugehörde / und der S. V. Schweins-Galgen. Von den Verlohreren aber wird annoch nachgefragt: Und das von Seyden und Silber gewürkstes Braſsletlein. Den von Schildkrott mit vergüldtem Möſing guarnirten Pirſchfänger / und die schwarze Flute traversiere Peitsche / 2c. Wer von eint oder ander verlohreren Artikeln oder Schlüſſen etwas in das Adreſſe-Contor bringen wird / soll eine erkleckliche Belohnung zu empfangen haben."
    },
    {
      "date": "1765-07-27",
      "tags_section": "Personen so ihre Dienste offeriren:",
      "text": "2. Mstr. Niclaus Brogli / wohnhafft in der Mädern Stadt an der Obern Rheingaß in dem sogenandten Rußgaßlein / offerirt seine Dienste in Einforde- rung Schuld – und andern Sachen / es ſeye im Sundgau / Marggraffenland / Baßler-Biſtum / Baſel-Gebieth oder anderstwo."
    },
    {
      "date": "1765-07-27",
      "tags_section": "Personen so ihre Dienste offeriren:",
      "text": "3. Herr Georg Müller von Lyon, welcher vor gerau- mer Zeit seine Dienste / in Verfertig-Accommodir- und Auſſerung so wohl neuer als alter Seyden- Galletjden – Faden – Woll- und Baumwollener Manns-Frauen und Jungſer-Strümpffen / auch in Verfertigung der Bagnoletten und Frauenſimmer-Taschen / offeriret / hat vergangene Woche sein Lo- sament abgeändert / und befindet sich nunmehro zu hinter der neuen-Vorſtatt in Frau Zuchsin Behausung / allwo er noch fürbas in dieſer Arbeit zu Manniglich beliebigen Diensten stehet."
    },
    {
      "date": "1765-07-27",
      "tags_section": "Allerhand Nachrichten:",
      "text": "Nachdeme die zum Trost und Wieder-Auſſauung der abgebrandt und sehr beschädigten Stadt Reülingen / er- richtete sechs Claiten Lottterie vor kurzer Zeit glücklich zu Ende gegangen und gezogen worden / so hat man aus Unrathen und Unfriſchen Wohl- geſinnter Ehren-Leuthen (welche zu beſſerer Herſtellung der allda ruinirten Gebäuden/Kirchen und Schulen / 2c. gerne ein Mehrers beytragen wolten) ent- schloſſen / derobſelben eine zweyte kleitere Lottterie, under wider- mahliger Garantie des daſig. Wohl. Magiſtrats nach esen; dero dießige Collecte dann wiedrum Verlegern dieſer Nach- richten Johann Burchardt im Adreſſe. Contor ist ausge- tragen worden; Es ist dieſſelbe sehr favorabel und artig einge- richtet und bestehet in drey Claiten und 10000. Roſen/ davon das Biſſel in die erste Clais 5. Gulden / in die andere 3. fl. und in die dritte 2. fl. kostet / wormit man confiderable Gewünſte bekommen kan/inmaßen nicht mehr als ein Fehler gegen einem Dreſſer / wie auß dem heruſs-gehenden Plan mit mehrerm zu ersehen ist. Damit man aber dieſſer Enden mehrern Luſt ein- zulegen / und weniger Urſach und Anlaß einigen Mißtrauens haben müße / so kan die Einlage zur Subſcription geschehen / nach deren man bey Einschreibung nur das halbe/namtlich an statt 1. fl. 2. fl. und ein halben Gulden / das ondere halbe aber kurz vor Ziehung der ersten Clais bezahlet thun. Es ist zwar die Ziehung derobſelben in dem Plan auf den Monath Aprilis aufgeschrieben worden / man ſuchet aber bereits zum Vorauſs"
    },
    {
      "date": "1765-07-27",
      "tags_section": "Man sucht zum Kauf",
      "text": "das selbige / sowohl wegen dero Vortheilhafftigkeit / als auch in Ansehung so vieler Herren Liebhabern / welche darinn ein Theil zu nehmen sich anerbotten haben / noch ehender comple- ment und zum Stande kommen werde / dahero die allhieſige re- ſpective Herren Liebhabers / umb so viel mehrers mit dero be- liebigen Einlagen zu eylen / ganz freundlich ersucht und ge- bätten werden / 2c."
    },
    {
      "date": "1765-07-27",
      "tags_section": "Man sucht zum Kauf",
      "text": "Man thut allen und jeden Ehren-Perſohnen / in der Eydgnoſſchafft / auch in den Zugewandt- und Benachbarten Orthen / so von Adelich / oder Patrici-iſchen Geschlechtern herstammen / hiemit kund und zuwüſſen / daß die von denen Wohl- Ehrwürdigen und Hochgel. rten Herren Patribus Bened. D. L. T. M. W. in Franzöliſcher Sprach und 3. Volum. in 4to. auffgeſezt / und von einem Königlich-Fran- zöliſchen Dolmetſchen / überſehen – und verbesserte groſſe Hiſtory / der alten und heutigen Schweitz / oder Eydgnoſſchafft / in dem Stand iſt / bald durch den Druck an das Licht zu kommen. Alle gedachte hoch-Adeliche und Ehren-Perſohnen nun/ sie seyen Geiſt – oder Weltlichen Standes / dero Vor- Elteren sich vor und nach der Schweizers Freyheit / durch ruhmliche Thaten befandt gemacht und diſtinguirt haben / können die Abzeichnungen derer Bildnuſſen / sambt der eigentlichen Beſchrei- bung ihrer Helden – Thaten einſeinden / umb dieſent Buch einverleibt zu werden / jedoch mit dieſem Be- ding/ daß man vor jedes Comreſtair zu ſtehen / von"
    },
    {
      "date": "1765-07-27",
      "tags_section": "Man sucht zum Kauf",
      "text": "6. Königlichen Zöllen hoch- fünffzig Francken Fran- köniſch Gelt erlege. Dieſenigen aber / welche ihre Bildnuſſen liebr anderwärts durch geſchickte und vortreffliche Meiſter auff 6. Zölligen Blatten-wol- len ſtehen laſſen / und ein/chicken/ thun den Herren Verlegern einen groſſern Gefallen / als wann sie die 50. Francken darſur bezahlten. Betreffende die umbſtändlichen und Hiſtorischen Berichte über je- des Geschlecht / solche mögen wenig oder viel Plag einnehmen / wird man keinen anderst / als gegen Erlegung 24. Francken geſagten Geldes annehmen. Man bittet übrigens ganz inniſtändig / ſo ſie ſich aber von denen Contrafeiten einzuſenden / ſie ſehen dann ihren Originalien durchauß gleichförmig / und mit der Feder oder Chineſiſchen Dinte ſeht wohl und sauber gezeichnet. Der Plan dieſer Hiſtory wird al- len denen zugestellt / welche zu der Zierde / Güte und Vollkommenheit derobſelben etwas beitragen wer- den. Man wird das Biſſel / die Abriß und Kupfer- Stücke / ſowohl bey Herrn Jadar, Königlichen Tre- lorier zu hüningen / als bey Herrn Werelher Wett- stein allhier in Baſel abnehmen / welche Herren ſich werden angelegen seyn laſſen / daß denen Herren Verlegern alles richtig zukomme."
    },
    {
      "date": "1765-07-27",
      "tags_section": "Man sucht zum Kauf",
      "text": "Der Author der Lateiniſchen Verwer-Zeitung ersuchet seine allhißige reſpective Herren E. Hhabers derobſelben zu- Contingent per das deſſe Jahr Dato mit dem Neuen Jahr ab- zuſtaſſen / obschon eigentlich der Termin noch nicht verfloſſen / will aber zu Recompempen deſſelben ein Regiſter von zwey- ten Jahren einſenden / und verſpricht mit dem Neuen Jahr hinſuhrd deſſen Zeitung exacter und realer einzurichten. Wer demnach noch schwerer Darmit continuiren wolte / beliebe sich ohnbeſchwerd zu erklären."
    },
    {
      "date": "1765-07-27",
      "tags_section": "Man sucht zum Kauf",
      "text": "Weilen die Liſta der Verſtorbenen / Getaufft – und Beerdigten ab der Landschafft noch nicht völlig eingetroffen / so iſt selbige biß über acht Tag verſchoben worden / da dann (geliebts Gott) eine exaete Verzeichnuß aller zu Stadt und Land getaufft / Berſtorben / und Verheirather / und zwar/ von den Getaufften / der Knablein und Magdlein Sonderbar/ nebst eint – und andern nöthl. Ein Anmerkungen / auff eines Sonderbaren Bogen gedruckt / erſolten folle / das Stuck per ein halben Bogen."
    },
